import React from 'react'

export default function DroneTelemetry() {

  const telemetry = {
    'Speed': '12 mph',
    'Altitude': '400 ft',
    'Distance': '0.68 mi',
    'waypoint': '2'



  }


  return (
    <div className='flex'>
      <div className='border rounded-md w-full columns-3'>
        <div className='border border-white rounded-md p-2'>
          speed: {telemetry.Speed}
        </div>

        <div className='border border-white rounded-md p-2 mb-4'>
          Altitude: {telemetry.Altitude}
        </div>

        <div className='border border-white rounded-md p-2'>
          Traveling to waypoint: {telemetry.waypoint}
        </div>

        <div className='border border-white rounded-md p-2'>
          Distance to Destination: {telemetry.Distance}
        </div>
      </div>



    </div>
  )
}
